We first note that the operating cash flow to net income ratio is calculated as:

  Operating Cash Flow to Net Income Ratio = (Net Cash Flow from Operating Activities) / (Net Profit)

For the provided data:
 • Net Cash Flow from Operating Activities = –5,394,333.52  
 • Net Profit = –1,175,062.19

Because both values are negative, their ratio will be a positive number. Taking the absolute values, we get:

  Ratio = 5,394,333.52 / 1,175,062.19 ≈ 4.59

Thus, the operating cash flow to net income ratio is approximately 4.59.

